import img5 from '../../image/img5.jpeg';
import img6 from '../../image/img6.jpeg';
import img7 from '../../image/img7.jpeg';
export const sliderItems = [
    {
        id:1,
        img:img5 , 
        title:"Natural Wood",
        par:"Wood Accessories from Nature",
        bg:"f5fafd"
    }
    ,
    {
        id:2,
        img:img6 , 
        title:"Our Design",
        desc:"Wood Accessories from Nature",
        bg:"fcf1ed"
    },
    {
        id:3,
        img:img7 , 
        title:"Creative Design",
        desc:"Wood Accessories from Nature",
        bg:"fcf1ed"
    }
]

export const categories = [
    {
        id:1 ,
        img:img5,
        title:"Table",
        cat:"table"
    }
    ,
    {
        id:2 ,
        img:img7,
        title:"Lamp",
        cat:"lamp"
    },
    {
        id:3 ,
        img:img6,
        title:"Decor",
        cat:"decor"
    }
]
